INSERT INTO `course` VALUES (26,'Master spcialis en Sciences Gospatiales et Gouvernance foncire (SGGF)','<ul><li><div>CONDITIONS DACCES</div><div>Prrequis acadmiques :</div><div>Les candidats issus des parcours Licence, Master ou Ingnieur sont ligibles et peuvent</div><div>dposer leurs dossiers dans les conditions ci-dessous :</div><div> Licence nationale en Mathmatique et/ou Informatique et/ ou Physique ou diplme</div><div>reconnu quivalent issu des facults des sciences ou sciences et techniques,</div><div> Licence professionnelle nationale en Gomatique, Goscience, Go-informatique,</div><div>Urbanisme et amnagement du Territoire ou diplme reconnu quivalent issu des</div><div>tablissements de lenseignement suprieur,</div><div> Licence nationale en sciences conomiques ou gestion, en gographie, ou en droit</div><div>assortie d\'un diplme de baccalaurat national en sciences mathmatiques, physiques</div><div>chimies ou Sciences de la vie et de la terre,</div><div> Ingnieur ou Master en : Sciences Gomatiques et Ingnierie Topographique,</div><div>Goinformation, Sciences Gographiques, Gnie Rural, Agroconomie, Gnie Civil, ou</div><div>tout diplme reconnu quivalent.</div><div><br></div><div>SELECTION DES ADMIS :</div><div>- Les candidats admissibles seront invits  un test oral.</div><div>- Les candidats admis suite au test oral seront invits pour complter leurs inscriptions.</div><div>- Les candidats de la liste d\'attente peuvent tre invits selon la disponibilit des postes.</div><div>- Les cours dmarreront le 20 septembre 2022.</div><div>FRAIS DU DOSSIER :</div><div>- Frais de dossier de 300,00 Dhs verss&nbsp; au compte de lENAM Hassan II ouvert  la Trsorerie Gnrale du Royaume sous le N 310 810 100002400 40187</div><div>SELECTION DES ADMISSIBLES :<br></div><div>Tous les candidats doivent soumettre en ligne leurs dossiers composs des lments</div><div>suivants :</div><div>- Copie conforme du diplme ou certificat. Loriginale du diplme ou du certificat est</div><div>exige pour tous les candidats retenus,</div><div>- Copies certifies conformes des relevs des notes des cycles des formations</div><div>poursuivies,</div><div>- Le nombre dannes exig pour une licence est de 3 ans et pour un cycle ingnieur ou</div><div>master est de 5 ans,</div><div>- Les candidats issus dune Licence doivent avoir des mentions assez bien tout au long</div><div>de leurs parcours et les candidats ingnieur ou master doivent avoir au minimum 3</div><div>mentions assez bien,</div><div>- Une note 12.00/20 par semestre ou par anne est quivalente  la mention Assez Bien,</div><div>- Une exprience professionnelle dune anne est quivalente  une mention assez bien,</div><div>- La date limite du dpt lectronique des dossiers est le 05 septembre 2022,</div><div>- La liste des candidats admissibles sera publie sur le site de lENAM Hassan II.</div><div>Prrequis linguistiques :</div><div>Certains modules peuvent tre dlivrs en anglais. Un niveau  intermediate comme</div><div>minimum requis en langue anglaise est exig pour les tudiants dont la langue dtudes</div><div>est autre que lAnglais. Pour les candidats issus des pays anglosaxons, il est exig davoir</div><div>un niveau intermdiaire au minimum en Franais pour pouvoir suivre les modules</div>enseigns en franais.</li></ul>',2022,'2022-09-05 00:00:00','2022-09-12 00:00:00','2022-09-05 00:00:00'),(27,'Sciences Gomatiques et Ingnierie Topographique','Dans\r\nla limite des places disponibles, l\'Institut Agronomique et Vtrinaire Hassan\r\nII organise un concours pour l\'accs en 1re Anne Cycle Ingnieur, Filires :\r\nSciences Gomatiques-Ingnierie Topographique et Gnie Rural. Ce concours est\r\nouvert aux candidats remplissant les conditions ci-dessous :\r\n\r\n<span><b>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</b><b><u>Conditions :</u></b></span>\r\n\r\n&nbsp; Titulaires des\r\ndiplmes suivants&nbsp;: DEUG, DEUST (maths, informatique, physique), Licence\r\n(maths, informatique, physique), Diplme de technicien en topographie ou\r\ntechnicien en Gnie Rural (bac+2).\r\n\r\n&nbsp; Avoir obtenu des\r\nmentions Bien durant la scolarit.\r\n\r\n&nbsp;\r\n\r\n<span><b>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</b><b><u>Comptence recherche :</u></b></span>\r\n\r\n&nbsp; Formation :\r\n(Mathmatiques, physique, informatique, statistiques et franais)\r\n\r\n&nbsp; Connaissances\r\ndans les domaines lis  la filire choisie (Topographie ou Gnie Rural).\r\n\r\n&nbsp;\r\n\r\n<span><b>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</b><b><u>Dossier de candidature :</u></b></span>\r\n\r\n&nbsp; Une demande\r\nmanuscrite adresse  Monsieur le Directeur de lENAM Hassan II, prcisant le\r\nchoix de la filire (Topographie ou Gnie Rural) ;\r\n\r\n&nbsp; Copie certifie\r\nconforme du Baccalaurat (recto-verso) ;\r\n\r\n&nbsp; Copies\r\ncertifies conformes des notes obtenues aprs le Baccalaurat ;\r\n\r\n&nbsp; Copie certifie\r\nconforme du diplme obtenu aprs le Baccalaurat ;\r\n\r\n&nbsp; Un C.V.\r\nprcisant les coordonnes du candidat (adresse, N de tlphone, e-mail) ;\r\n\r\n&nbsp; Copie lgalise\r\nde la CIN ;\r\n\r\n&nbsp; Reu du virement\r\nde 240,00 DHS pour les frais d\'tude du dossier, verss au compte de lENAM Hassan\r\nII ouvert  la Trsorerie Gnrale du Royaume sous le N 310 810 100002400\r\n40187.\r\n\r\n&nbsp;\r\n\r\n<span><b>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</b><b><u>Date de soumission des dossiers :</u></b></span>\r\n\r\n<span>&nbsp; <i>Jeudi 30 juin\r\n2022 </i>: Dernier dlai\r\nde rception des dossiers sur la plateforme de lENAM Hassan II.</span>\r\n\r\n&nbsp;\r\n\r\n<span><b>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</b><b><u>Modalits de slection&nbsp;</u></b><span>: Etude de dossier, test et entretien\r\n<b><u></u></b></span></span>',2022,'2022-06-30 00:00:00','2022-07-15 00:00:00','2022-06-30 00:00:00');
