INSERT INTO `school_field` VALUES (40,'Sciences et Technologies de l\'Espace : \"Systmes Mondiaux de Navigation par Satellites\" (GNSS)','2020-01-01 00:00:00','test'),(41,'Master en Modlisation et Management des projets BIM','2020-01-01 00:00:00','Master en Modlisation et Management des projets BIM'),(42,'Sciences Gospatiales et Gouvernance Foncire (SGGF)','2021-09-10 00:00:00','Conditions d\'accs:<br><ul><li>Licence nationale en Mathmatique et/ou Informatique et/ ou Physique ou diplme reconnu quivalent</li><li>Licence professionnelle nationale accrdite en Gomatique, Goscience, Go-informatique, Urbanisme et amnagement du Territoire ou diplme reconnu quivalent.</li><li>Licence nationale en sciences conomiques ou gestion, en gographie, ou en droit assortie d\'un diplme de baccalaurat national en sciences mathmatiques, physique &amp; chimie ou Sciences de la vie et de la terre.</li><li>Ingnieur ou Master en : Sciences Gomatiques et Ingnierie Topographique, Go-information, Sciences Gographiques, Gnie Rural, Agroconomie, Gnie Civil, ou tout diplme reconnu quivalent.</li><li>Conditions Prrequis linguistiques&nbsp;: Certains modules seront enseigns en anglais. Un niveau  intermdiate  comme minimum requis en langue anglaise est exig pour les tudiants algriens, marocains, mauritaniens et tunisiens. Pour les candidats des pays Egypte et Soudan, il est exig davoir un niveau intermdiaire au minimum en Franais pour pouvoir suivre les modules enseigns en franais.</li></ul><ul><li>NB&nbsp;: Les candidats issus dun parcours Licence doivent justifier des mentions assez bien au minimum tout au long de leurs parcours,</li><li>Les candidats issus du parcours ingnieur ou master doivent justifier au minimum 3 mentions assez bien tout au long de leurs parcours,</li></ul><br><br>Dossier de candidature (  scanner et  soumettre en ligne du 17 septembre&nbsp;&nbsp;au 04 octobre 2021  23h59:<br><ul><li>Une demande manuscrite adresse  M. le Directeur de l\'ENAM Hassan II ;</li><li>Copie certifie conforme du Baccalaurat (recto-verso) ;</li><li>Copie certifie conforme des diplmes obtenus aprs le Baccalaurat ;</li><li>Copies certifies conformes des notes obtenues aprs le Baccalaurat ;</li><li>Copie de la CIN ;</li><li>Paiement en ligne sur le compte de l\'ENAM&nbsp;&nbsp;ouvert  la Trsorerie Gnrale du Royaume, compte bancaire : RIB&nbsp;:&nbsp; 310 810 10000 2400 40187 0145&nbsp; &nbsp;ou fournir le reu du paiement des frais d\'tude du dossier&nbsp;: (300,00 DHS, Non remboursables), verss sur le mme compte de lENAM&nbsp;</li></ul>');
